package io.intino.alexandria.office;

import java.io.File;
import java.net.URISyntaxException;

public class MicroSiteBuilderOfTsv_ {

	public static void main(String[] args) {
		MicroSiteBuilderOfTsv builder = new MicroSiteBuilderOfTsv(config());
		File temp = new File("./temp/out.zip");
		temp.getParentFile().mkdirs();
		builder.build(fileOf("/example.tsv"), temp);
	}

	private static File fileOf(String name) {
		try {
			return new File(MicroSiteBuilderOfTsv_.class.getResource(name).toURI());
		} catch (URISyntaxException e) {
			e.printStackTrace();
			return null;
		}
	}

	private static MicroSiteBuilderOfTsv.Config config() {
		MicroSiteBuilderOfTsv.Config result = new MicroSiteBuilderOfTsv.Config();
		result.logo("data:image/jpeg;base64,");
		result.title("Title for site");
		result.description("Lorem ipsum dolor sit amet");
		result.add(new MicroSiteBuilderOfTsv.Config.Column("Column 1", 0));
		result.add(new MicroSiteBuilderOfTsv.Config.Column("Column 2", 1));
		result.add(new MicroSiteBuilderOfTsv.Config.Column("Column 3", 2));
		return result;
	}

}
